import React, {Component} from "react"
import Particles from "react-particles-js";

class Secondary extends Component {
  render() {
    return (
      <div className="particle">
        <Particles
          params={{
            "number-density.area": 800,
          }}
        />
        />
      </div>
    );
  }
}

export default Secondary
